Aneesh and Anaisha’s Jaipur wedding was a celebration of love, tradition, and togetherness. Anaisha’s jewelry, lovingly handcrafted by her mother, added a personal touch to every moment, while their friends brought boundless energy and joy, making every ritual unforgettable. Love truly filled the air as laughter echoed through the stunning royal setting. Capturing their most intimate moments, we created one of the most breathtaking photo galleries—every frame a story of warmth, beauty, and connection.


